            (80, 7, 2, '人生において人間関係から受ける影響がとても大きい人です。人との関わりで気持ちが揺らぎやすく、他者からの評価を気にして、どううまく付き合うかに心を砕きます。人間関係全般がうまく行くように無意識的に勤めるため、自分を置き去りにしてでも人に合わせることができます。そのため、初めての人でも臆することなく上手に接することができ、接客業や人気商売に向いていたりもしますが、人からの影響を受けやすく、気持ちが疲弊してしまうかもしれません。また、結婚は早い傾向で、結婚相手からの影響も非常に強く受けます。', 'House content of the 7 house by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-08-07 22:10:15', 'Solar content of the 7 house by planet 2', 'Solar content of the 7 house by planet 2'),
