            (93, 8, 2, '心理学や目に見えない世界、霊やオカルト、死後の世界、性的なテーマなど、世間一般がタブー視するものに興味があります。そのため、小さいころから人はなぜ死ぬのか、死んだらどうなるのかと考えすぎて眠れなくなるとか、人の心の深層を知りたい、といった関心が強い子どもだったのではないでしょうか。人の死や遺産、資産に関わる仕事を選択することもあります。結婚をすると相手の親族から多くの影響を受ける傾向もあり、それで苦しい思いをする可能性もあれば、遺産や家系的な仕事を相続することもあります。目に見えない世界とのつながりが強く、霊的な感受性が強い場合もあるでしょう。', 'House content of the 8 house by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-08-07 22:10:15', 'Solar content of the 8 house by planet 2', 'Solar content of the 8 house by planet 2'),
