            (119, 10, 2, '社会的な活動や公的な活動に関心が深いでしょう。女性や大衆、子ども相手の仕事が向いている傾向にありますので、客商売や人気商売全般に適性があります。仕事では浮き沈みもありますが、どんな人にもうまく働きかけることができるようになります。仕事と私生活の境界が無くなる傾向がありますが、家で仕事をしたり、あなたの素朴なままのスタイルで無理なくできるものを仕事にしていくといいでしょう。', 'House content of the 10 house by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-08-07 22:10:15', 'Solar content of the 10 house by planet 2', 'Solar content of the 10 house by planet 2'),
