            (132, 11, 2, '友達が多かったり、いろいろな人と関わることを好みますが、その関係性には変化も多く、あまり安定しません。仲間との活動やコミュニティ活動を積極的に行いますが、その関係に変化も多く、それを自然に受け入れているので、誰とでもうまく関わることができると同時に、特定の何かや誰かに執着することもありません。自由な精神や世の中をより良くしたい気持ちがあり、その思想をライフスタイルに組み込む傾向があるため、移動や変化の多い生活になる人もいます。インターネットやSNSを活用して人と繋がることも得意ですし、そういった発信を通して多くの人に働きかけることもできます。', 'House content of the 11 house by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-08-07 22:10:15', 'Solar content of the 11 house by planet 2', 'Solar content of the 11 house by planet 2'),
