            (145, 12, 2, '周囲から孤立した自分だけの世界にいることを好みます。直感力や空想力があり、子どもの頃から目に見えない世界とのパイプを強く持ち、感受性が豊かだったのではないでしょうか。目に見えない世界とのパイプが強いため、芸術活動、創作活動、癒しの力や占いなどに適性があります。マイペースに楽しめる孤立した時間、癒しやリラックスが大切な人です。芸術、何かの創作、瞑想や精神性の探求、スピリチュアルなものを生活に取り入れるといいでしょう。また、子どもや女性を対象とした創作活動や癒しやヒーリングの提供で人気を得ることができます。', 'House content of the 12 house by planet 2', 0, NULL, '2023-09-18 08:45:39', '2024-08-07 22:10:15', 'Solar content of the 12 house by planet 2', 'Solar content of the 12 house by planet 2'),
